const SelectReset = () => {
  const seconds = [10, 20, 30, 40, 50];

  return (
    <div id="selectReset">
      {seconds.map((a, i) => {
        <select>
          <option value={a} key={i}>
            {a}
          </option>
        </select>;
      })}
    </div>
  );
};

export default SelectReset;
